function CategoriesTable(){
    // console.log(props);
    return (
        <div>
            <h1>Dynamic table</h1>
            <table className="table table-striped">
            <thead>
                <tr>
                <th scope="col">#</th>
                <th scope="col">First</th>
                <th scope="col">Last</th>
                <th scope="col">Handle</th>
                </tr>
            </thead>
            <tbody>
                
            </tbody>
            </table>
        </div>
    )
}
export default CategoriesTable;
